import { Link } from "react-router-dom";
import { useParams } from "react-router-dom"

const Test = () => {

  const { key } = useParams();

  return (
    <div>
      <span>Test view - ID: {key}</span>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
    </div>
  )
}

export default Test;
